import React from "react";

function Pizza() {
  return (
    <div>
      <h2>Pizza</h2>
      <img src="/pizzas/spinaci.jpg" alt="Spinac pizza" />
    </div>
  );
}

export default function App() {
  return (
    <div>
      <h1>Hello React!</h1>
      <Pizza />
      <Pizza />
      <Pizza />
    </div>
  );
}
